%remember to also change them in the function since they are not parsed
Gamma = 4.46;
Theta_Twist = 35.575;
Raise = 3.4; %Angstrom
Phase_Shift = 0;
Defect_Type = 1; %1 is for overtwist, 3 is for undertwist (Defect_Type +1 is for their respective K20 versions)
Under_Opposite = true; %This is used to calculate energy landscape on the other side as well

Tilt_Array = [[-1.4,0.0,-0.1,-1.7];[0.0,1.4,1.5,-0.5];[0.5,1.7,0.1,0.0];[-1.5,0.1,0.0,-0.1]];
