K_Raise_Array = [[21.748,25.547,23.860,29.496];[21.914,21.748,22.820,18.235];[18.235,29.496,30.312,14.164];[22.820,23.860,25.860,30.312]];


Geometric_Properties = Tilt_Array;
Geometric_Properties(:,:,2) = K_Tilt_Array;
Geometric_Properties(:,:,3) = Roll_Array;
Geometric_Properties(:,:,4) = K_Roll_Array;
Geometric_Properties(:,:,5) = Twist_Array;
Geometric_Properties(:,:,6) = K_Twist_Array;
Geometric_Properties(:,:,7) = Raise_Array;
Geometric_Properties(:,:,8) = K_Raise_Array;

%The Geometric_Properties array is parsed into the functions
InternalSteps = 10;
Internalmove = 1;
Chromatin_Position = 5; %SHL = -7 + Chromatin_Position so now it's at -2, double check this later though
N = 147;
Total_DNA_String = length(DNAStringList(:,1));

%Amino_Unbinding_Cost = [0,repmat([12,0],1,12)]; %12 kT for the K20 but 0 for the K10
%Amino_Unbinding_Cost = [0,11.2,0,12.8,0,9.2,0,10.1,0,14.4,0,16.2,0,16.2,0,14.4,0,10.1,0,9.2,0,12.8,0,11.2,0]
%This is the high value I use for undertwist
Amino_Unbinding_Cost = [0,repmat([12,0],1,13)];
Chromatin_Energy_Landscape = zeros(10,27); 
if Under_Opposite
    Chromatin_Energy_Landscape_Opp = zeros(10,27);
    Defected_Energy_Opp = zeros(27,6);
    Average_Defect_Energy_Opp = zeros(1,27);
end

for w=1:InternalSteps

    Average_Defect_Energy = zeros(1,27);
    Defected_Energy = zeros(27,6);
    
    Average_Undefected_Energy = 0;
    for d=1:Total_DNA_String
        DNAString = DNAStringList(d,w+Internalmove:N+w+Internalmove);

        [DNA_Geometry,DNAIndexation] = GeomArrayMaker(DNAString,1,Geometric_Properties);%1 is to denote the mode, see function description

        Undefected_Energy = EnergyValuesCalculator(DNA_Geometry,DNAIndexation,Geometric_Properties,true,true,true,true);
        Average_Undefected_Energy = Average_Undefected_Energy + sum(sum(Undefected_Energy))/Total_DNA_String;
        for k=1:14 %K10 loop
            [Defected_DNA_Geom,AminoBP] = DefectIntroducer(DNA_Geometry,k,Defect_Type);
            Temporary_Code = EnergyValuesCalculator(Defected_DNA_Geom,DNAIndexation,Geometric_Properties,true,true,true,true);
            sum(sum(Undefected_Energy(7+k*10:147,:) - Temporary_Code(7+k*10:147,:)))
            Defected_Energy(2*(k-1)+1,:) = sum(Temporary_Code);
            %Here we only take a small part of the energy landscape which
            %we use for the later movement
            Chromatin_Energy_Landscape(w,2*(k-1)+1) = Chromatin_Energy_Landscape(w,2*(k-1)+1) + (sum(sum(Temporary_Code(1:6+10*(14-Chromatin_Position),:)- Undefected_Energy(1:6+10*(14-Chromatin_Position),:))))/Total_DNA_String;
        end

        Peak_Defect_Energies = zeros(1,15); %index 1 and 15 correspond with boundaries
        Peak_Defect_Energies(1) = 12; %Filler values for now, paper says 9.2, maybe replace?
        Peak_Defect_Energies(15) = 12;
        for l=1:13 %K20 loop
            [Defected_DNA_Geom,AminoBP] = DefectIntroducer(DNA_Geometry,l,Defect_Type+1);
            Temporary_Code = EnergyValuesCalculator(Defected_DNA_Geom,DNAIndexation,Geometric_Properties,true,true,true,true);
            Defected_Energy(2*l,:) = sum(Temporary_Code);
            %Note we only add the unbinding cost for the cross probability
            %calculation we do here, not when we calculate the average, this is
            %later after the for loop
            Peak_Defect_Energies(l+1) = sum(Defected_Energy(2*l,:)) + Amino_Unbinding_Cost(2*l) - sum(sum(Undefected_Energy));
            Chromatin_Energy_Landscape(w,2*l) = Chromatin_Energy_Landscape(w,2*l) + (sum(sum(Temporary_Code(1:6+10*(14-Chromatin_Position),:)- Undefected_Energy(1:6+10*(14-Chromatin_Position),:))))/Total_DNA_String;

        end

        %Note we have (array - constant) but matlab was made by some geniusses that
        %knows what I mean with this
        Average_Defect_Energy = Average_Defect_Energy + (sum(Defected_Energy,2).' - sum(sum(Undefected_Energy)))/Total_DNA_String;


        Crossing_Probabilities = CrossingProbabilities(Peak_Defect_Energies);
        
        %We do this sometimes if we want the energy landscape for the
        %undertwist
        if Under_Opposite
            
            
            for k=1:14 %K10 loop
                [Defected_DNA_Geom,AminoBP] = DefectIntroducer(DNA_Geometry,k,3);
                Temporary_Code = EnergyValuesCalculator(Defected_DNA_Geom,DNAIndexation,Geometric_Properties,true,true,true,true);
                %sum(sum(Undefected_Energy(7+k*10:147,:) - Temporary_Code(7+k*10:147,:)))
                Defected_Energy_Opp(2*(k-1)+1,:) = sum(Temporary_Code);
                
                Chromatin_Energy_Landscape_Opp(w,2*(k-1)+1) = Chromatin_Energy_Landscape_Opp(w,2*(k-1)+1) + (sum(sum(Temporary_Code(1:6+10*(Chromatin_Position),:)- Undefected_Energy(1:6+10*(Chromatin_Position),:))))/Total_DNA_String;
            end
            
            for l=1:13 %K20 loop
                [Defected_DNA_Geom,AminoBP] = DefectIntroducer(DNA_Geometry,l,4);
                Temporary_Code = EnergyValuesCalculator(Defected_DNA_Geom,DNAIndexation,Geometric_Properties,true,true,true,true);
                Defected_Energy_Opp(2*l,:) = sum(Temporary_Code);
                Chromatin_Energy_Landscape_Opp(w,2*l) = Chromatin_Energy_Landscape_Opp(w,2*l) + (sum(sum(Temporary_Code(1:6+10*(Chromatin_Position),:)- Undefected_Energy(1:6+10*(Chromatin_Position),:))))/Total_DNA_String;

            end
            
        end
        
    end

    Average_Undefected_Energy;
    
    %Adding unbinding cost to average
    Average_Defect_Energy_With_Cost = Average_Defect_Energy + Amino_Unbinding_Cost;
    Chromatin_Energy_Landscape(w,1:2*(14-Chromatin_Position)) = Chromatin_Energy_Landscape(w,1:2*(14-Chromatin_Position)) + Amino_Unbinding_Cost(1:2*(14-Chromatin_Position));
    %I use a bigger value for the opposite side because sometimes it is not
    %enough (K20 smaller energt than K10)
    Chromatin_Energy_Landscape_Opp(w,1:2*(Chromatin_Position)) = Chromatin_Energy_Landscape_Opp(w,1:2*(Chromatin_Position)) + 1.3*Amino_Unbinding_Cost(1:2*(Chromatin_Position));
    %Take note Chromatin_Energy_Landscape_Opp(w,10) is wrong since we
    %didn't sum over the full defect, we don't care though we set this as a
    %hard bound which we cannot cross
    
    
    %This part also calculates crossing probabilities if we average the defect
    %energies
    
    Averaged_Peak_Defect_Energies = zeros(1,14);
    Averaged_Peak_Defect_Energies(1) = 12;
    Averaged_Peak_Defect_Energies(14) = 12;
    for i=1:12
        Averaged_Peak_Defect_Energies(1+i) = Average_Defect_Energy_With_Cost(2*i);
    end
    Averaged_Crossing_Probabilities = CrossingProbabilities(Averaged_Peak_Defect_Energies);



end

XValuesEnergies = linspace(-6.5,6.5,27);
plot(XValuesEnergies,Average_Defect_Energy)
